  <h2 class="anchor anchorWithStickyNavbar_JmGV" id="strings">Strings<a href="https://jestjs.io/docs/using-matchers#strings" class="hash-link" aria-label="Direct link to Strings" title="Direct link to Strings">​</a></h2>
